import React, { useState } from 'react';
import '../CharacterPart.css';
import eyesData from '../assets/eyes';
import hairData from '../assets/hair';
import lipsData from '../assets/lips';
import handsData from '../assets/hands';

const CharacterPart = () => {
    return (
    <section class="person">
        <div class= "profileWrapper">
            <div  class="headFixed">
                <div class="eyesWrapper">
                    <img class="eyes" src='./assets/eyes/Sunglasses.png' />
                </div>
                <div class="lipsWrapper">
                    <img class="lips" src='./assets/lips/Angry.png' />
                </div>
            </div>
            <div class='bodyFixed'>
            </div>
        </div>
    </section>
    )
}

export { CharacterPart };
